import React from 'react'
import {makeStyles} from "@material-ui/core/styles"
import {Typography, Box} from "@material-ui/core";
import Navbar from "./Navbar"

const useStyles = makeStyles(theme=>({
    mainContainer: {
        background: "#4E538F"
    },
    timeLine: {
        position: "relative",
        padding: "16px",
        margin: "0 auto",
        "&:before": {
            content: "''",
            position: "absolute",
            height: "100%",
            border: "1px solid tan",
            right: "40px",
            top: 0
        },
        "&:after": {
            content: "''",
            display: "table",
            clear: "both"
        },
        [theme.breakpoints.up("md")]:{
            padding: "32px",
            "&:before": {
                left: "calc(50% - 1px)",
                right: "auto"
            }
        }
    },
    timeLineYear: {
        textAlign: "center",
        maxWidth: "156px",
        margin: "0 48px 0 auto",
        fontSize: "28.8px",
        background: "red",
        color: "white",
        lineHeight: 1,
        padding: "8px 0 16px",
        "&:before": {
            display: "none"
        },
        [theme.breakpoints.up("md")]: {
            textAlign: "center",
            margin: "0 auto",
            "&:nth-of-type(2n)": {
                float: "none",
                margin: "0 auto"
            },
            "&:nth-of-type(2n):before": {
                display: "none"
            }
        }
    }
}));

const Resume = () => {
    const classes = useStyles();
    return (
        <>
        <Navbar/>
        <Box component="header" className={classes.mainContainer}>
            <Typography variant="h4" align="center">
                Wrking
            </Typography>
            <Box component="div" className={classes.timeLine}>
                <Typography variant="h2"className={classes.timeLineYear}>
                    2020
                </Typography>
            </Box>
        </Box>
        </>
    )
}

export default Resume
